import React , { Component } from 'react';
//import App from './App';
import { Link } from "react-router-dom";

export default class Header extends Component {
    render(){
        return(<div className="Header">
            <img style="-webkit-user-select: none;margin: auto;https://icon2.cleanpng.com/20180623/tab/kisspng-franz-kafka-the-zrau-aphorisms-letters-to-milena-franz-reuleaux-5b2ebc0a948a25.2995202215297894506084.jpg" width="200" height="200"/>
            <ul className="menu-ul">
                <li><Link to="/">Home</Link></li>
                <li><Link to="/about">About</Link></li>
                <li><Link to="/contact">Contact</Link></li>
            </ul>
        </div>
        )
    }
}

//export default App;
